How to update a field universally in MongoDB?<p>I have 1 database: <code>database</code>.
There are 2 collections in database: <code>users</code>, <code>posts</code>.
Mongoose schemas: <code>User</code>, <code>Post</code>.</p>
<p>Here is a <code>user</code>:</p>
<pre><code>{
  &quot;_id&quot;: &quot;5f0e99abef55507333f0c34ef45&quot;,
  &quot;name&quot;: &quot;David&quot;,
  &quot;email&quot;: &quot;david@email.com&quot;
}
</code></pre>
<p>I can <code>post</code> something with the <code>user</code> and save it to the <code>posts</code> collection.</p>
<pre><code>let user = await User.findById(req.user.id);
let newPost = new Post({
  post: req.body.post,
  by: user, // this is the important part
});
await newPost.save();
</code></pre>
<p>And here is the new <code>post</code> with a <code>by</code> field:</p>
<pre><code>&quot;_id&quot;: &quot;3287327392392293243434&quot;,
&quot;post&quot;: &quot;this is david's post&quot;,
&quot;by&quot;: {
  &quot;_id&quot;: &quot;5f0e99abef55507333f0c34ef45&quot;,
  &quot;name&quot;: &quot;David&quot;,
  &quot;email&quot;: &quot;david@email.com&quot;
  }
</code></pre>
<p>And then I <code>update</code> my profile to this:</p>
<pre><code>{
  &quot;_id&quot;: &quot;5f0e99abef07333f0c34ef45&quot;,
  &quot;name&quot;: &quot;Dave&quot;, // change from David to Dave
  &quot;email&quot;: &quot;david@email.com&quot;
}
</code></pre>
<p>After this I send a <code>get</code> request to get all posts:</p>
<pre><code>[{
&quot;_id&quot;: &quot;3287327392392293243434&quot;,
&quot;post&quot;: &quot;this is david's post&quot;,
&quot;by&quot;: {
  &quot;_id&quot;: &quot;5f0e99abef07333f0c34ef45&quot;,
  &quot;name&quot;: &quot;David&quot;,
  &quot;email&quot;: &quot;david@email.com&quot;
  },
}]
</code></pre>
<p>The problem is that the <code>by</code> field has the same object, nothing was updated here after I updated my name. It's still David and not Dave. I know that when I updated my profile I only updated the user, not the post. I could write the code like to update the post too, but if I have many posts, many comments, and I change my name, image, biography or other fields regularly, then way too many things happen when updating my profile (and maybe thousands of posts).</p>
<p>What I want is that when I update my <code>user</code> profile, is there a way to be updated across this MongoDB database? Like I want that <code>by</code> field in the <code>post</code> to show my updated name.</p>
<p>Is it something to do with the user schema?</p>

