How many roundtrips are made to a MongoDB server when using transactions?<p>I wonder how many roundtrips that are made to the server when using transactions MongoDB? For example if the Java driver is used like this:</p>
<pre><code>ClientSession clientSession = client.startSession();
TransactionOptions txnOptions = TransactionOptions.builder()
        .readPreference(ReadPreference.primary())
        .readConcern(ReadConcern.LOCAL)
        .writeConcern(WriteConcern.MAJORITY)
        .build();

TransactionBody txnBody = new TransactionBody&lt;String&gt;() {
    public String execute() {
        MongoCollection&lt;Document&gt; coll1 = client.getDatabase(&quot;mydb1&quot;).getCollection(&quot;foo&quot;);
        MongoCollection&lt;Document&gt; coll2 = client.getDatabase(&quot;mydb2&quot;).getCollection(&quot;bar&quot;);

        coll1.insertOne(clientSession, new Document(&quot;abc&quot;, 1));
        coll2.insertOne(clientSession, new Document(&quot;xyz&quot;, 999));
        return &quot;Inserted into collections in different databases&quot;;
    }
};
try {
    clientSession.withTransaction(txnBody, txnOptions);
} catch (RuntimeException e) {
    // some error handling
} finally {
    clientSession.close();
}
</code></pre>
<p>In this case two documents are stored in a transaction:</p>
<pre><code>coll1.insertOne(clientSession, new Document(&quot;abc&quot;, 1));
coll2.insertOne(clientSession, new Document(&quot;xyz&quot;, 999));
</code></pre>
<p>Are the &quot;insert operations&quot; stacked up and sent to the server in one roundtrip or are two calls (or more?) actually made to the server?</p>

