SpringData Mongo projection ignore and overide the values on save<p>Let me explain my problem with SpringData mongo, I have the following interface declared, I declared a custom query, with a projection to ignore the index, this example is only for illustration, in real life I will ignore a bunch of fields.</p>
<pre><code>public interface MyDomainRepo extends MongoRepository&lt;MyDomain, String&gt; {
    @Query(fields=&quot;{ index: 0 }&quot;)
    MyDomain findByCode(String code);
}
</code></pre>
<p>In my MongoDB instance, the MyDomain has the following info, <code>MyDomain(code=&quot;mycode&quot;, info=null, index=19)</code>, so when I use the <code>findByCode</code> from MyDomainRepo I got the following info <code>MyDomain(code=&quot;mycode&quot;, info=null, index=null)</code>, so far so good, because this is expected behaviour, but the problem happens when..., I decided to save the <code>findByCode</code> return.</p>
<p>For instance, in the following example, I got the <code>findByCode</code> return and set the <code>info</code> property to <code>myinfo</code> and I got the object bellow.</p>
<pre><code>MyDomain(code=&quot;mycode&quot;, info=&quot;myinfo&quot;, index=null)
</code></pre>
<p>So I used the <code>save</code> from MyDomainRepo, the index was ignored as expected by the projection, but, when I save it back, with or without an update, the SpringData Mongo, overridden the <code>index</code> property to null, and consequently, my record on the MongoDB instance is overridden too, the following example it's my MongoDB JSON.</p>
<pre><code>{
    &quot;_id&quot;: &quot;5f061f9011b7cb497d4d2708&quot;,
    &quot;info&quot;: &quot;myinfo&quot;,
    &quot;_class&quot;: &quot;io.springmongo.models.MyDomain&quot;
}
</code></pre>
<p>There's a way to tell to SpringData Mongo, to simply ignores the null fields on saving?</p>

