Using .catch with async/await<p>I am wondering if I can still use <code>.catch()</code> within an async function to catch the error instead of using a <code>try-catch</code> block.</p>
<p>The following code is from my project using MongoDB and Express:</p>
<pre><code>router.get('/communities', EnsureAuthenticated, async (req, res) =&gt;{ 

//Look up the user in the db + populate the community field 
const userInfo = await User_DB
.findOne({ _id:req.user._id, })
.populate('communities') 
.lean()
.catch(err =&gt; {
console.log(err)
 res.status(500)
.json({
 msg: 'DB: Error Fetching User Info',
});

// rest of the functions that take userInfo as the input

});

</code></pre>
<p>When using <code>try-catch</code> all variables will be limited to within the scope of that <code>try-catch</code> block.</p>
